import React from 'react';
import "./style-city.css";
function CityModal({ isOpen, onClose }) {
  return (
    <div>
      {isOpen && (
        <div className="modal">
          <div className="modal-content">
            <span className="close" onClick={onClose}>
              &times;
            </span>
            <p>Выберите город:</p>
            <ul>
              <li>Новосибирск</li>
              <li>Кемерово</li>
            </ul>
          </div>
        </div>
      )}
    </div>
  );
}

export default CityModal;
